       "title": "The Items Schema"
     },
     "has_more": {
       "$id": "#/properties/has_more",
       "type": "boolean",
       "title": "The Has_more Schema",
       "default": false,
       "examples": [
         false
       ]
     },
     "quota_max": {
       "$id": "#/properties/quota_max",
       "type": "integer",
       "title": "The Quota_max Schema",
       "default": 0,
       "examples": [
         300
       ]
     },
     "quota_remaining": {
       "$id": "#/properties/quota_remaining",
       "type": "integer",
       "title": "The Quota_remaining Schema",
       "default": 0,
       "examples": [
         266
       ]
     }
   }
 }
